import React from 'react'
import Avatar from './Components/Avatar/avatar';



const App = () => {

  const avatar = {
    "id": 1,
    "name": "Fausto Silva",
    "curse": "Ciência da Computação"
  };



  return (
    <div className="App">
      <div className="Sidebar">
          <Avatar
            avatar={avatar}
          />
      </div>
    </div>
  );
}

export default App;
